import React from 'react';

const Good = (data) => (
    <div className='card'>
        <div className='card__picture'>
            <img src={`http://localhost:5000/files/${data.data.img}`} alt={data.data.name}/>
        </div>
        <input className='card__text' value={data.data.name}/>
        <p className='card__text'>{data.data.cost}</p>
    </div>
)

export default Good;
